const convertBase64 = () =>{
    const b= $('#upload').prop('files')[0];
     
    if(b.size > 1048576){
        alert("File is too big!");
        b.value = "";
     }else{
        return new Promise(function(resolve) {
            var reader = new FileReader();
            reader.onloadend = function() {
                resolve(reader.result)
            }
            reader.readAsDataURL(b);
        })
    }        
}



